import { useState } from "react";
import Form from "./Components/Form";
import List from "./Components/List";


function App() {

  const [Todos, setTodos] = useState([{
    name:"do something",
    description: `Phasellus id quam et urna pulvinar luctus quis sit amet ante. Etiam elementum 
    commodo nibh id dictum. Sed egestas felis ut volutpat varius. Aliquam ipsum ante, viverra a 
    ante eget, ultricies ornare neque. Etiam ac cursus nisl, ac ullamcorper neque. Sed quis tellus 
    pulvinar augue sollicitudin porta. Curabitur malesuada venenatis posuere. Curabitur mattis turpis 
    id mauris laoreet, blandit bibendum neque blandit. Quisque bibendum lectus ex,scelerisque varius velit 
    suscipit eu. Morbi erat orci, consectetur in orci ut, commodo tincidunt nisi. Proin pharetra semper ligula in gravida.`,
    status: true ,
  }]);

  return (
    <div className="mt-10">
      <h1 className="text-5xl font-bold text-center" >To-DoApp</h1>
      <div className="mt-20 flex justify-evenly items-start">
        <Form setTodos={setTodos} Todos= {Todos} />
        <List Todos={Todos} />
      </div>
    </div>
  );
}

export default App;
